import React from "react";
import { NavLink } from 'react-router-dom';
import NavBar from "./NavBar";

function Home() {

  return (
    <>
      <NavBar/>
      <div className="title-div">
        <h1 className="title">The Forest</h1>
        <NavLink to="/start">Start Game</NavLink>
      </div>
    </>
  )
}

export default Home
